import React, { useState } from "react";

import { BrowserRouter, Routes, Route } from "react-router-dom";

import Main from "./task4/Main";

import Html from "./task4/Html";

function App() {

  const [groupName, setGroupName] = useState(""); // Store groupName globally
  const[data,setData]=useState([])

  return (
<BrowserRouter>
<Routes>
<Route path="/" element={<Main data={data} setsetGroupName={setGroupName} />} // Pass setter to Main

        />
<Route

          path="/Html/:groupName"

          element={<Html groupName={groupName} />} // Pass groupName to Html

        />
</Routes>
</BrowserRouter>

  );

}

export default App;
